import React from "react";
import "./src/assets/css/VirtualDimensionsContainer.css";

const VirtualDimensionsContainer = () => {
  return (
    <div className="virtual-dimensions-container">
      <h1 className="virtual-dimensions-title">Virtual Dimensions</h1>
      <p className="virtual-dimensions-subtitle">
        Creating Virtual Tours for the Modern World
      </p>
    </div>
  );
};

export default VirtualDimensionsContainer;
